        backgroundImage: `url(${background})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "100% 100%",
        height: "100vh",
        width: "100%",
      }}
    >
      <form id="form" action="">
        <TextField
          id="outlined-required"
          required
          label="Name"
          placeholder="Enter your name here"
          value={data2.name}
          onChange={(event) => setData2({ name: event.target.value })}
        />
        <br /> <br />
        <TextField
          id="outlined-number"
          required
          autoComplete="username"
